import "./Sidebar.css";

const Sidebar = () => {
  return (
    <div className="sidebarcontainer">
      <div className="top">
        <div className="logo">
          <h1>LOGO.</h1>
        </div>
      </div>
      <div className="center">
        <div className="containersidebarcenter">
          <ul className="ulsidebarmenu">
            <li><ion-icon size="large" name="game-controller-outline"/>Games</li>
            <li><ion-icon  size="large" name="bookmarks-outline"/>Favorites</li>
            <li>My Games</li>
          </ul>
        </div>
      </div>
      <div className="bottom">bot</div>
    </div>
  );
};

export default Sidebar;
